const intialState = {
    name: "안수환",
    age: 25,
    password: "zz",
};


const changeNickname = {
    type: "CHANGE_NICKNAME",
    data: "안수환환",
};

// (이전상태, 액션) => 다음상태
const rootRedicer = (state = intialState, action) => {
    switch (action.type) {
        case "CHANGE_NICKNAME":
            return {
                ...state,
                name: action.data,
            };
    }
};

export default rootRedicer;
